import React from 'react';
import { Box, Button } from '@material-ui/core';
import HeaderForms from '../Components/HeaderForms';


function TelaDois() {
    return (
        <div class="background">
            <Box 
                sx={{
                    width: 550,
                    height: 750,
                    backgroundColor: 'white',
                    borderRadius: 5,
                    padding: 5,
                }}
                centered
            >
                <HeaderForms/>
                <form action="TelaTres.jsx">
                    <label for="linkedin" class="labelText text-style">Linkedin</label>
                    <input type="text" id="linkedin" class="inputText" placeholder="https://www.linkedin.com/in/foo-bar-3a0560104/"/>
                    <label for="github" class="labelText text-style">Github *</label>
                    <input type="text" id="github" class="inputText" required placeholder="https://github.com/foobar"/>
                    <Button type="submit" variant="contained" color="primary" width="sm">
                        Next
                    </Button>
                </form>
            </Box>
        </div>
    );
}
export default TelaDois;
